import { StyleSheet} from 'react-native';
const stockComponentStyles = StyleSheet.create({
  div:{
    backgroundColor: '#003247',
    paddingHorizontal:15,
    margin:10,
    borderRadius:5,
  },
  rendelt:{
    color:'#fff',
    fontWeight: "bold"
  },
  telefonadat:{
    color:'#fff',
    paddingLeft:10,
    paddingRight:5
  }
});
export {stockComponentStyles};
